import React from 'react';
import { NavLink } from 'react-router-dom';
import './Header.scss';
import { PersonOutline } from '@material-ui/icons';

const Header = () => {
  return (
    <div className="head">
      <span className="head-title">POSTS </span>
      <div className="l-wrap">
        <NavLink className="user" activeClassName="active" exact to="/">
          Home
        </NavLink>
        <NavLink className="user" activeClassName="active" exact to="/post">
          Posts
        </NavLink>
        <NavLink className="user" activeClassName="active" exact to="/signup">
          Singup
        </NavLink>
        <NavLink className="user" activeClassName="active" exact to="/Login">
          Login
        </NavLink>
        <span className="user username">
          <PersonOutline /> Hi, Pankaj
        </span>
      </div>
    </div>
  );
};

export default Header;
